script: |
  super -f text -I q9439.spq | sort > q9439.out

inputs:
  - name: q9439.spq
    data: |
      SELECT DISTINCT + 94 - col0 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE col0 NOT BETWEEN + col2 + + 99 AND - col0;
  - name: tab1

outputs:
  - name: q9439.out
    data: |
      3
      43
      9
